const Home = () => {
  return (
    <>
      <div className="container-fluid mb-5 mt-5">
        <div className="row">
          <div className="col-xl-10 col-lg-12 co-md-112 col-sm-12 mx-auto">
            <div className="row g-3">
              <CardApp />
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Home;
